import { StyleSheet } from "react-native";

export default StyleSheet.create({
    centered: {
        textAlign: "center",
    },

    h1: {
        fontSize: 24,
        lineHeight: 32,
        fontFamily: "bold",
    },
    h2: {
        fontSize: 20,
        lineHeight: 28,
        fontFamily: "bold",
    },
    h3: {
        fontSize: 14,
        lineHeight: 24,
        fontFamily: "bold",
    },

    body: {
        fontSize: 14,
        lineHeight: 24,
        fontFamily: "regular",
    },
    bodySemibold: {
        fontFamily: "semibold",
    },
    bodyBold: {
        fontFamily: "bold",
    },
});
